import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import { WEBSITE_NAME } from '../../../utils/websiteData';
import useStyles from './login-jss';
import styled from 'styled-components';

const StyledDiv = styled.div`
  width: 60%;
  margin: 16px auto;
  border: 1px solid #eee;
  box-shadow: 0 2px 3px #ccc;
  padding: 16px;
  text-align: center;
  borderRadius: '10px',
  'box-shadow': '0px 13px 26px rgb(109,184,241, 0.16)',

  @media (min-width: 500px) {
    width: 450px;
  }
`;


const Login = () => {


  const classes = useStyles();
  const [user, setUser] = useState({
    username: '',
    password: '',
  });

  const { username, password } = user;

  const onChange = (e) => setUser({ ...user, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();

    if (username === '' || password === '') {
      console.log('Please enter all fields');
    }
  };


  return (
    <StyledDiv>
      <Helmet>
        <title>{`${WEBSITE_NAME} | Login`}</title>
      </Helmet>
      <div className={`${classes.root} card-shadow text-center`}>
        <h3 className='title'>Sign in</h3>
          <span className='subtitle'> use your email and password provided by your organization </span>
        <form className='mt-4' onSubmit={onSubmit}>
          <div className='form-group'>
            <input
              className='input-text'
              type='text'
              name='username'
              value={username}
              placeholder='Username'
              onChange={onChange}
              required
            />
          </div>

          <div className='form-group'>
            <input
              className='input-text'
              type='password'
              name='password'
              value={password}
              placeholder='Password'
              onChange={onChange}
              required
            />
          </div>


          <input
            type='submit'
            value='Login'
            className='button-primary mt-3'
          />
        </form>
        <p className='form-link mt-3'>
          Login Trouble ? {' '}
          <Link to='/login'>
            <span>Reset password</span>
          </Link>
        </p>
      </div>
    </StyledDiv>
  );
}

export default Login;
